import GetProductos from './components/GetProductos';
import CrearProducto from './components/CrearProducto';
import EditarProducto from './components/EditarProducto';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React from 'react'; //importo para poder usar el fragment



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
        {/* cada ruta tiene dos partes la url y el componente que se va a renderizar */}
          <Route path="/" element={<GetProductos/>}/> 
          <Route path='/crearProducto' element={<CrearProducto/>}></Route>
          <Route path='/editarProducto/:id' element={<EditarProducto/>}></Route>
        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
